import React from 'react';
import { View } from 'react-native';
import { Footer, FooterTab, Button, Icon } from 'native-base'; // Import components from native-base

const FooterScreen = () => {
  return (
    <Footer>
      <FooterTab>
        <Button vertical>
          <Icon name="home" />
        </Button>
        <Button vertical>
          <Icon name="chatbubbles" />
        </Button>
        <Button vertical>
          <Icon name="person" />
        </Button>
      </FooterTab>
    </Footer>
  );
};

export default FooterScreen;
